import { Component, OnInit } from '@angular/core';
import { SQLiteService } from '../sqlite.service';

@Component({
  selector: 'app-sqlite-list',
  templateUrl: './sqlite-list.component.html',
  styleUrls: ['./sqlite-list.component.css'],
})
export class SQLiteListComponent implements OnInit {
  items: any[] = [];

  constructor(private sqliteService: SQLiteService) {}

  ngOnInit(): void {
    this.sqliteService.getAllItems().then((data) => {
      this.items = data;
    });
  }
}
